import React, { useEffect } from 'react';
import './App.css';
import OpenLinkWebSDK from './components/OpenLinkWebSDK';

function App() {
  useEffect(() => {
    if (typeof chrome !== 'undefined' && chrome.runtime && chrome.runtime.getURL) {
      const contentScript = document.createElement('script');
      contentScript.src = chrome.runtime.getURL('content.js');
      contentScript.onload = () => {
        console.log('Content script loaded');
      };
      document.body.appendChild(contentScript);

      return () => {
        document.body.removeChild(contentScript);
      };
    }
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h3>Mesh App Example</h3>
        <div className="OpenLink">
          <OpenLinkWebSDK />
        </div>
      </header>
      <div>
        <h1>WebSocket Events</h1>
        <div id="events"></div>
      </div>
    </div>
  );
}

export default App;
